import React from 'react';
const Skill = React.forwardRef((props, ref, name, icon) => {
  return (
    <div className="skill">
      <img src={`/images/${icon}`} alt={`${name} icon`} className="skill-icon" />
      <p>{name}</p>
    </div>
  );
});

export default Skill;
